import telephone from './images/telephone-icon.jpg';
import envelope from './images/envelope-icon.png';

export default function Contact(props) {
  return (
    <div className='parent'>
        <div className='adjust'>
        <div className='contact'>
              <img src={ props.image } alt='contact avatar' />
          </div>
          <h2>{ props.name }</h2>
          <div>
          <span><img src={ telephone } alt='telephone'/> { props.number }</span>
          </div>
          <div>
          <span><img src={ envelope } alt='email'/> { props.email }</span>
          </div>
        </div>
    </div>
  );
};
